import confetti from "canvas-confetti";
import rawL10n from "./l10n/index";
const confettiExtPicture =
  "data:image/png;base64,";
type l10nId = keyof (typeof rawL10n)["zh-cn"];
(function (Scratch) {
  if (Scratch.extensions.unsandboxed === false) {
    throw new Error("Sandboxed mode is not supported");
  }
  // Your extension's code
  class confettiScratch implements Scratch.Extension {
    runtime: VM.Runtime;
    _formatMessage: any;
    constructor(runtime: VM.Runtime) {
      this.runtime = runtime;
      // @ts-ignore
      this._formatMessage = runtime.getFormatMessage(rawL10n);
    }
    l10n(id: l10nId) {
      return this._formatMessage({
        id,
        default: id,
        description: id,
      });
    }
    _fixL10n(args: { id: l10nId; default: string }) {
      return this.l10n(args.id);
    }
    getInfo() {
      return {
        color1: "#3DBF8F",
        id: "confetti",
        name: this._fixL10n({
          id: "confetti.name",
          default: "",
        }),
        blocks: [
          {
            blockType: Scratch.BlockType.LABEL,
            text: this._fixL10n({
              id: "confetti.label.1",
              default: "",
            }),
          },
          {
            blockType: Scratch.BlockType.COMMAND,
            opcode: "fullConfetti",
            text: this._fixL10n({
              id: "confetti.fullConfetti",
              default: "(), [ctype]",
            }),
            arguments: {
              ctype: {
                type: Scratch.ArgumentType.STRING,
                menu: "ctype",
              },
            },
          } as Scratch.CommandBlock,
          {
            blockType: Scratch.BlockType.COMMAND,
            opcode: "sideConfetti",
            text: this._fixL10n({
              id: "confetti.sideConfetti",
              default: "(), [ctype], [time] ",
            }),
            arguments: {
              ctype: {
                type: Scratch.ArgumentType.STRING,
                menu: "ctype",
              },
              time: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 3,
              },
            },
          } as Scratch.CommandBlock,
          {
            blockType: Scratch.BlockType.COMMAND,
            opcode: "snowConfetti",
            text: this._fixL10n({
              id: "confetti.snowConfetti",
              default: ", [time] ",
            }),
            arguments: {
              time: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 5,
              },
            },
          },
          {
            blockType: Scratch.BlockType.LABEL,
            text: this._fixL10n({
              id: "confetti.label.2",
              default: "",
            }),
          },
          {
            blockType: Scratch.BlockType.COMMAND,
            opcode: "customConfetti",
            text: this._fixL10n({
              id: "confetti.custom",
              default:
                "() x [x] (0~1),y [y] (0~1), [d] (90), [ctype]. [s] , [co] (HEX )",
            }),
            arguments: {
              x: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 0.5,
              },
              y: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 0.5,
              },
              d: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 90,
              },
              ctype: {
                type: Scratch.ArgumentType.STRING,
                menu: "ctype",
              },
              s: {
                type: Scratch.ArgumentType.NUMBER,
                defaultValue: 45,
              },
              co: {
                type: Scratch.ArgumentType.STRING,
                defaultValue: "",
              },
            },
          },
        ] as (Scratch.Block | Scratch.Separator)[],
        menus: {
          ctype: {
            acceptReporters: false,
            items: [
              {
                text: this._fixL10n({
                  id: "confetti.type.caidai",
                  default: "",
                }),
                value: "caidai",
              },
              {
                text: this._fixL10n({
                  id: "confetti.type.star",
                  default: "",
                }),
                value: "star",
              },
            ],
          },
        },
      };
    }
    customConfetti(args: Record<string, string>) {
      confetti({
        origin: {
          x: args.x ? Number(args.x) : 0.5,
          y: args.y ? Number(args.y) : 0.5,
        },
        angle: args.d ? Number(args.d) : 90,
        zIndex: 2147483647, // z-index
        shapes: args.ctype === "caidai" ? undefined : ["star"],
        startVelocity: args.s ? Number(args.s) : undefined,
        colors: args.co
          ? (() => {
              try {
                return JSON.parse(args.co);
              } catch {
                // 
                console.error("Invalid colors ", args.co);
                return undefined;
              }
            })()
          : undefined,
      });
    }
    snowConfetti(args: Record<string, string>) {
      let duration = Number(args.time) * 1000;
      let animationEnd = Date.now() + duration;
      let skew = 1;

      function randomInRange(min: number, max: number) {
        return Math.random() * (max - min) + min;
      }

      (function frame() {
        let timeLeft = animationEnd - Date.now();
        let ticks = Math.max(200, 500 * (timeLeft / duration));
        skew = Math.max(0.8, skew - 0.001);

        confetti({
          zIndex: 2147483647, // z-index
          particleCount: 1,
          startVelocity: 0,
          ticks: ticks,
          origin: {
            x: Math.random(),
            // since particles fall down, skew start toward the top
            y: Math.random() * skew - 0.2,
          },
          colors: ["#ffffff"],
          shapes: ["circle"],
          gravity: randomInRange(0.4, 0.6),
          scalar: randomInRange(0.4, 1),
          drift: randomInRange(-0.4, 0.4),
        });

        if (timeLeft > 0) {
          requestAnimationFrame(frame);
        }
      })();
    }
    fullConfetti(args: Record<string, string>) {
      let count = 200;
      let defaults = {
        origin: { y: 0.7 },
      };

      function fire(particleRatio: number, opts: confetti.Options | undefined) {
        confetti({
          ...defaults,
          ...opts,
          particleCount: Math.floor(count * particleRatio),
          zIndex: 2147483647, // z-index
          shapes: args.ctype === "caidai" ? undefined : ["star"],
          colors:
            args.ctype === "caidai"
              ? undefined
              : ["FFE400", "FFBD00", "E89400", "FFCA6C", "FDFFB8"],
        });
      }

      fire(0.25, {
        spread: 26,
        startVelocity: 55,
      });
      fire(0.2, {
        spread: 60,
      });
      fire(0.35, {
        spread: 100,
        decay: 0.91,
        scalar: 0.8,
      });
      fire(0.1, {
        spread: 120,
        startVelocity: 25,
        decay: 0.92,
        scalar: 1.2,
      });
      fire(0.1, {
        spread: 120,
        startVelocity: 45,
      });
    }
    sideConfetti(args: Record<string, string>) {
      let end = Date.now() + Number(args.time) * 1000;

      let colors = ["#bb0000", "#ffffff"];

      (function frame() {
        confetti({
          zIndex: 2147483647, // z-index
          particleCount: 2,
          angle: 60,
          spread: 55,
          origin: { x: 0 },
          colors: args.ctype === "caidai" ? colors : undefined,
          shapes: args.ctype === "caidai" ? undefined : ["star"],
        });
        confetti({
          zIndex: 2147483647, // z-index
          particleCount: 2,
          angle: 120,
          spread: 55,
          origin: { x: 1 },
          colors: args.ctype === "caidai" ? colors : undefined,
          shapes: args.ctype === "caidai" ? undefined : ["star"],
        });

        if (Date.now() < end) {
          requestAnimationFrame(frame);
        }
      })();
    }
  }

  if (!Scratch.vm.runtime.gandi) {
    // For Turbowarp
    Scratch.extensions.register(new confettiScratch(Scratch.runtime));
  } else {
    // For Gandi
    window.tempExt = {
      Extension: confettiScratch,
      info: {
        extensionId: "confetti",
        name: "confetti.name",
        description: "confetti.description",
        iconURL: confettiExtPicture,
        featured: false,
        disabled: false,
        collaboratorList: [
          {
            collaborator: "bug",
            collaboratorURL: "https://ccw.site/student/197354885",
          },
        ],
      },
      l10n: {
        "zh-cn": {
          "confetti.name": "",
          "confetti.description":
            " Scratch ~",
        },
        en: {
          "confetti.name": "Confetti",
          "confetti.description":
            "Spray confetti in Scratch! Unrestricted by the stage, spray all over the web~",
        },
      },
    };
  }
})(Scratch);
